import { createGlobalStyle } from 'styled-components'

const GlobalStyle = createGlobalStyle`
  background-color: red;
`;

const App = () => (
  <div className="container">
    <GlobalStyle />
    <CardBook
      post={{
        title: 'aa',
        image: '//aa',
        user: {
          username: 'aa',
          avatar: '//aa'
        },
        count: {
          likes: 1
        }
      }}
    />
  </div>
)

export default App
